export function WindowStoreProvider({
  children,
}: {
  children: React.ReactNode
}) {
  const [state, setState] = useState({
    about: { isOpen: false, setAboutWindowState },
  })

  function setAboutWindowState(value: boolean) {
    setState((state) => ({
      ...state,
      about: {
